def update_rank_and_slot(hero: HeroUser) -> None | HeroInfo:
    print("sync info")
    # hero_info_rank_list = []
    # hero_info_slots_list = []

    hero_pk = hero.pk
    hero_rank = hero.rank
    hero_owner = hero.owner
    hex_value = int(hero_pk, 16)
    hero_type_id = uint16(hex_value >> (64 + 8 + 8)).value & 0xFFFF
    rarity_id = uint8(hex_value >> 64).value & 0xFF
    # sync rank
    if hero_rank != hero.info.rank:
        # print(f"updating rank from {hero.info.rank} to {hero_rank}")
        hero.info.rank = hero_rank

    if hero.info.rarity is None:
        hero.info.rarity_id = rarity_id

    if hero.info.hero_type is None:
        hero.info.hero_type_id = hero_type_id

    return hero.info
