def sync_info(queryset_heroes: QuerySet) -> None:
    hero_info_list = []
    update_rank_and_slot_list = []
    for hero in queryset_heroes:
        # print("hero", hero)
        hero_pk = hero.pk
        hero_rank = hero.rank
        hero_owner = hero.owner

        # check info
        if not hasattr(hero, "info"):
            # check onchain
            if hero.is_on_chain:
                hex_value = int(hero_pk, 16)
                hero_type_id = uint16(hex_value >> (64 + 8 + 8)).value & 0xFFFF
                rarity_id = uint8(hex_value >> 64).value & 0xFF

                hero_info = HeroInfo(
                    nft_id=hero_pk,
                    rank=hero_rank,
                    hero_type_id=hero_type_id,
                    rarity_id=rarity_id,
                    owner=hero_owner,
                )
                if rarity_id is None or hero_type_id is None:
                    try:
                        sentry_sdk.capture_exception(
                            Exception(
                                f"""nft_id={hero_pk},
                                    rank={hero_rank},
                                    hero_type_id={hero_type_id},
                                    rarity_id={rarity_id},
                                    owner={hero_owner},"""
                            )
                        )
                    except:
                        pass
                hero_info_list.append(hero_info)
            # check offchain
            if not hero.is_on_chain:
                hero_info = HeroInfo(
                    nft_id=f"{hero_owner}{'0' * 5}{hero_pk[-1]}",
                    rarity_id=1,
                    hero_type_id=int(hero_pk[-1]),
                    rank_id=0,
                    owner=hero_owner,
                )
                hero_info_list.append(hero_info)
        else:
            updated_hero_info = update_rank_and_slot(hero)
            if updated_hero_info is not None:
                update_rank_and_slot_list.append(updated_hero_info)

    print("len creating hero_info:", len(hero_info_list))
    print("len updating hero_info:", len(update_rank_and_slot_list))
    HeroInfo.objects.bulk_create(hero_info_list)
    HeroInfo.objects.bulk_update(update_rank_and_slot_list, ["rank", "rarity", "hero_type"])


class HeroUserList(generics.GenericAPIView):
    """
    List of user's owned heroes.
    """

    # queryset = HeroUser.objects.all()
    serializer_class = HeroUserSerializer
    permission_classes = [IsAuthenticated]

    def get_queryset(self):
        # Here you can do the following thing:
        current_user = self.request.user
        username = current_user.get_username()
        return (
            HeroUser.objects.filter(owner=username)
            .filter(is_deleted=False)
            .prefetch_related(
                Prefetch(
                    "info",
                    queryset=HeroInfo.objects.prefetch_related(
                        "rarity", "hero_type", "rank"
                    ),
                ),
                # Prefetch("rank", queryset=HeroRank.objects.all()),
                "owner",
                "rank",
            )
            .all()
        )

    def get(self, request, *args, **kwargs):
        queryset = self.get_queryset()
        # create_info_if_not_exists(queryset_heroes=queryset)
        # queryset = self.get_queryset()
        sync_info(queryset)
        queryset = self.get_queryset()
        serializer = self.get_serializer(queryset, many=True)
        return Response(serializer.data)


class HeroSlots(generics.ListCreateAPIView):
    """
    Get list of equipped Heroes.
    Set list of 5 heroes slots.
    """

    serializer_class = HeroUserSlotSerializer
    permission_classes = [IsAuthenticated]

    def get_queryset(self):
        # Here you can do the following thing:
        current_user = self.request.user
        # current_user = get_user_model().objects.get(pk=190)
        # And use it as you wish in the filtering below:
        return Player.objects.filter(user=current_user)

    def list(self, request, *args, **kwargs):
        player = self.get_queryset().first()
        if player is not None:
            return Response(HeroUserSlotSerializer(player.team_slot_data).data)
        else:
            return Response(
                {"error": "No player found"}, status=status.HTTP_404_NOT_FOUND
            )

    def post(self, request, *args, **kwargs):
        current_user = self.request.user
        serializer = HeroUserSlotSerializer(data=request.data)
        serializer.is_valid(raise_exception=True)
        player = self.get_queryset().first()
        if player is None:
            return Response({"success": False}, status=status.HTTP_400_BAD_REQUEST)

        if (
            player.game_play_stage is not None
            and not player.game_play_stage.is_completed
        ):
            return Response(
                {"error": "Cannot set team while playing"},
                status=status.HTTP_400_BAD_REQUEST,
            )

        hero_set_list = []
        # Validate if hero id use more than once
        for x in [1, 2, 3, 4, 5]:
            if serializer.validated_data["slot" + str(x)] is not None:
                hero_set_list.append(serializer.validated_data["slot" + str(x)].pk)
        if len(hero_set_list) != len(set(hero_set_list)):
            return Response(
                data="same hero cannot use more than once",
                status=status.HTTP_400_BAD_REQUEST,
            )

        # Validate if hero id exists
        timestamp = int(timezone.now().timestamp()) - (24 * 60 * 60)
        for x in [1, 2, 3, 4, 5]:
            if serializer.validated_data["slot" + str(x)] is not None:
                if (
                    serializer.validated_data["slot" + str(x)].transferred_at
                    > timestamp
                ):
                    return Response(
                        data="Hero cannot be used for 24 hours after transfer",
                        status=status.HTTP_400_BAD_REQUEST,
                    )
                if serializer.validated_data["slot" + str(x)].owner != current_user:
                    return Response(
                        data="Not owned hero in slot" + str(x),
                        status=status.HTTP_400_BAD_REQUEST,
                    )

        # Validate slot5
        #if serializer.validated_data["slot5"] is not None:
        #    max_level = player.get_max_hero_rental_slot_level()
        #    if serializer.validated_data["slot" + str(x)].info.level > max_level:
        #        return Response(
        #            {"error": "slot5 rental item needed"},
        #            status=status.HTTP_400_BAD_REQUEST,
        #        )
        player.team_slot = request.data
        player.save()
        return Response(request.data)


class GemSlotsList(generics.GenericAPIView):
    """
    Get list of user gem.
    Set list of 5 gems slots.
    """

    serializer_class = GemSlotInputSerializer

    # permission_classes = []
    permission_classes = [IsAuthenticated]

    # lookup_field = "hero_nft"

    def get_queryset(self):
        # return HeroInfo.objects.all()
        # current_user = get_user_model().objects.get(pk=170)
        current_user = self.request.user
        return HeroInfo.objects.filter(owner=current_user)

    def get(self, request, hero_nft, *args, **kwargs):
        hero = (
            self.get_queryset()
            .filter(nft_id=hero_nft, herouser__is_deleted=False)
            .first()
        )
        if hero is not None:
            gem_equip = GemUser.objects.filter(hero=hero)
            gem_equip_dict = {x.slot: x for x in gem_equip}
            res = {
                "slot1": GemSerializer(gem_equip_dict[1].gem).data
                if 1 in gem_equip_dict and gem_equip_dict[1].gem is not None
                else None,
                "slot2": GemSerializer(gem_equip_dict[2].gem).data
                if 2 in gem_equip_dict and gem_equip_dict[2].gem is not None
                else None,
                "slot3": GemSerializer(gem_equip_dict[3].gem).data
                if 3 in gem_equip_dict and gem_equip_dict[3].gem is not None
                else None,
                "slot4": GemSerializer(gem_equip_dict[4].gem).data
                if 4 in gem_equip_dict and gem_equip_dict[4].gem is not None
                else None,
                "slot5": GemSerializer(gem_equip_dict[5].gem).data
                if 5 in gem_equip_dict and gem_equip_dict[5].gem is not None
                else None,
            }
            return Response(res)
        else:
            return Response(
                {"error": "No hero found"}, status=status.HTTP_404_NOT_FOUND
            )

    # def list(self, request, *args, **kwargs):
    #     equipped_gems = self.get_queryset().filter(gem_slot__gt=0)
    #     equipped_gems_list = []
    #     for i in range(1, 6):
    #         if equipped_gems.filter(gem_slot=i).first() is not None:
    #             serializer = GemUserSerializer(equipped_gems.filter(team_slot=i).first())
    #             equipped_gems_list.append(serializer.data)
    #         else:
    #             equipped_gems_list.append({})
    #     return Response(equipped_gems_list)

    def put(self, request, hero_nft, *args, **kwargs):
        serializer = GemSlotInputSerializer(data=request.data)
        serializer.is_valid(raise_exception=True)

        hero = (
            self.get_queryset()
            .filter(nft_id=hero_nft, herouser__is_deleted=False)
            .first()
        )
        if hero is None:
            return Response(
                {"error": "No hero found"}, status=status.HTTP_404_NOT_FOUND
            )
        player = Player.objects.get(user=self.request.user)
        max_level = player.get_max_gem_rental_slot_level()
        for x in [1, 2, 3, 4, 5]:
            gem = serializer.validated_data["slot" + str(x)]
            if gem is not None:
                if gem.level_needed > hero.level:
                    return Response(
                        {"error": "more level require"},
                        status=status.HTTP_400_BAD_REQUEST,
                    )
                elif x == 5 and gem.level_needed > max_level:
                    return Response(
                        {"error": "slot5 rental item needed"},
                        status=status.HTTP_400_BAD_REQUEST,
                    )
        player.sync_gem_equip()
        gem_balance = ItemBalance.objects.filter(
            address=hero.owner, resource__in=Gem.objects.all()
        )
        heroes = HeroInfo.objects.filter(
            owner=hero.owner, herouser__is_deleted=False
        ).exclude(nft_id=hero)
        current_use_balances = (
            GemUser.objects.filter(hero__in=heroes, gem__isnull=False)
            .values("gem")
            .annotate(count=Count("gem"))
        )
        require_balance = {x["gem"]: int(x["count"]) for x in current_use_balances}
        for x in [1, 2, 3, 4, 5]:
            gem_id = serializer.validated_data["slot" + str(x)]
            if gem_id is not None:
                if gem_id.nft_id in require_balance:
                    require_balance[gem_id.nft_id] += 1
                else:
                    require_balance[gem_id.nft_id] = 1
        for gem_id in require_balance:
            count = require_balance[gem_id]
            try:
                if int(gem_balance.get(resource=gem_id).balance) < count:
                    return Response(
                        {"error": "Gem not enough"}, status=status.HTTP_400_BAD_REQUEST
                    )
            except ItemBalance.DoesNotExist:
                return Response(
                    {"error": "Gem not enough"}, status=status.HTTP_400_BAD_REQUEST
                )
        for x in [1, 2, 3, 4, 5]:
            try:
                slot = GemUser.objects.get(slot=x, hero=hero)
                slot.gem = serializer.validated_data["slot" + str(x)]
                slot.save()
            except GemUser.DoesNotExist:
                GemUser.objects.create(
                    slot=x, hero=hero, gem=serializer.validated_data["slot" + str(x)]
                )

        return Response(request.data)


