class GemBuy(mixins.CreateModelMixin, generics.GenericAPIView):
    queryset = GemUser.objects.all()
    serializer_class = GemBuySerializer
    permission_classes = [IsAuthenticated]

    def post(self, request):
        serializer = GemBuySerializer(data=request.data)
        serializer.is_valid(raise_exception=True)
        gem_nft_id = serializer.validated_data["nft_id"]
        amount = serializer.validated_data["amount"]

        gem = get_object_or_404(Gem, nft_id=gem_nft_id)
        if gem.is_on_chain:
            return Response(
                {"message": "This gem is on-chain."}, status=status.HTTP_400_BAD_REQUEST
            )

        cost = gem.price * amount
        player = Player.objects.get(user=request.user)
        if player.gold < cost:
            return Response(
                {"message": "not enough gold"}, status=status.HTTP_400_BAD_REQUEST
            )
        player.gold -= cost

        with transaction.atomic():
            GemUser.objects.bulk_create(
                [GemUser(user=request.user, gem=gem) for _ in range(amount)]
            )
            player.save()

        return Response(request.data)


